$--very-darkblue: hsl(216, 12%, 8%);
$--medium-grey: hsl(216, 12%, 54%);
$--light-grey: hsl(217, 12%, 63%);
$--semi-darkblue: hsl(219, 12%, 21%);
$--dark-blue:hsl(213, 19%, 15%);
$--header-color: white; 
$--orange-color: hsl(25, 97%, 53%); 
$--main-font: 'Overpass', sans-serif;
$--heavy-font-weight: 700;
$--light-font-weight:400; 
$--text-font-size: 15px; 


* { 
    padding: 0px;
    margin: 0px;
}

body { 
    background: $--very-darkblue;
    height: 100vh;
    display: flex;
    flex-direction: column;
    justify-content: center;
    align-items: center;
    color: $--header-color;
    font-family: $--main-font;
    position: relative;
}

.attribution { 
    position: absolute;
    bottom: 80px;
    left: 600px;
}

.card { 
    width:330px;
    height: 325px;

    margin-bottom: 20px;

    position: relative;

    &__rate { 
        border-radius: 30px;

        position: absolute;

        display: flex;
        flex-direction: column;
        justify-content: center;

        z-index: 1;
        
        width: 100%;
        height: 100%;
        padding: 20px 20px;

        background-color: $--dark-blue;
    }


   &__thankyou { 
        border-radius: 30px;

        position: absolute;

        

        width: 100%;
        height: 100%;
        padding: 20px 20px;
        
        background-color: $--dark-blue;

        
        flex-direction: column;
        align-items: center;

        

        &--img { 
            margin-top: 10px;
            margin-bottom: 25px;
        }

        &--rate { 
        
            border-radius: 20px;

            background-color: $--semi-darkblue;

            color: $--orange-color;
            
            font-size: 14px;

            padding: 7px 20px;
            margin-bottom: 25px;
        }

        &--thankyou { 
            margin-bottom:15px ;

            font-size: 25px;
        }

        &--text { 
            
            color: $--light-grey;
            text-align: center;
            font-size: 15px;
        }
        
    }
}


.rate { 

    &__star { 

        

        &--icon { 
        
            background-color: $--semi-darkblue;

            display: flex;
            align-items: center;
            justify-content: center;

            height: 10px;
            width: 10px;
            padding: 15px 15px;

            margin-top: 15px;
            margin-bottom: 25px;
            
            border-radius:500px ;

        }
    }

    &__title { 
        font-weight: $--heavy-font-weight;
        font-size: 25px;

        margin-bottom: 10px;
    }

    &__text { 
        font-size: $--text-font-size;
        color: $--light-grey;
    }

    &__container { 
        list-style-type: none;

        display: flex;
        justify-content: space-around; 

        margin-top: 25px;
        margin-bottom: 25px;

        &--numbers{ 
            border-radius: 5000px ;
            border-color: transparent;

            background-color: $--semi-darkblue;
            color: $--light-grey;
            font-weight: $--light-font-weight;

            width: 50px;
            height: 50px;

            display: flex;
            justify-content: center;
            align-items: center;

            padding: 10px 10px;
            
            &:hover{ 
                cursor: pointer;

                background-color: $--orange-color;
                color: $--header-color;
            }

            &:focus { 
                background-color: $--light-grey;
                color: white;
            }
            
        }
    }

    &__submit { 
        border-radius: 50px;
        border: transparent;

        padding: 10px 10px;

        background-color: $--orange-color;
        
        font-family: $--main-font;
        font-size: 15px;
        letter-spacing: 3px;
        color: $--header-color;


        &:hover { 
            background-color: $--header-color;
            color: $--orange-color;
            
            cursor: pointer;
        }
    }
}


.attribution { font-size: 11px; text-align: center;  }
.attribution a { color: hsl(228, 45%, 44%); position: relative;}

#home__website { 
    width: 25px;
    position: absolute;
    

    bottom: -2px;
    left: 5px;
}
